description:
Key to my Heart is not just for Valentines, its for life!! Ok well it doesn&#8217;t have to be its optional, it is also optional to give the key to someone special or just keep it together. The Key fits into the gap in the heart. These are perfect as a gift to say how much someone means to you!

	&#8220;He who holds the key can open my heart&#8230;&#8221;

	This necklace comes on a delicate 16inch chain.
